import React from 'react'

const Profile = (props) => {
    if (!props.profile) {
        return (
            <h3>Loading...</h3>
        )
    }

    return (
        <div>
            <h1>this is pokemon</h1>
            <h3>{props.profile.map(item => {
                return (
                    <div>{item.id}</div>
                )
            })}</h3>

        </div>
    )
}

export default Profile;
